import React from "react";
import PropTypes from "prop-types";

// component: function that returns HTML
// 리액트는 컴포넌트를 사용해서 HTML처럼 작성하려는 경우에 필요하고
// 이러한 조합을 JSX라고 한다
// 리액트에서의 개념
// JSX는 리액트에서의 HTML이다
// JSX는 컴포넌트에 정보를 보낼 수 있다
// food componetn에 fav라는 이름의 property를 kimchi라는 value로 준 것

// props 내부에는 fav가 있다. props.fav 써도 됨
// 대문자로 시작해야함

function Food({ name, picture, rating }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <h4>rating: {rating}/5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
}

const foodILike = [
  {
    id: 1,
    name: "kimchi",
    image:
      "https://www.platingsandpairings.com/wp-content/uploads/2014/12/Kimchi-5.jpg"
    //rating: 5
  },
  {
    id: 2,
    name: "sushi",
    image:
      "data:image/jpeg;base64,",
    rating: "4.3"
  },
  {
    id: 3,
    name: "kimbap",
    image:
      "https://www.thespruceeats.com/thmb/IyxiJdbwFaixy4iolNYTLjBmW_w=/4288x2848/filters:fill(auto,1)/kimbap-korean-sushi-rolls-2118795-Hero-5b7dbdd346e0fb00250718b8.jpg",
    rating: 2.9
  },
  {
    id: 4,
    name: "chikorita",
    image:
      "data:image/png;base64,",
    rating: 5
  },
  {
    id: 5,
    name: "chocolate",
    image:
      "data:image/jpeg;base64,",
    rating: 3
  }
];

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number
};

//컴포넌트는 재사용할 수 있다
// map: array로부터 array 전달
// dish는 object이다
/*
function renderFood(dish) {
  console.log(dish);
  return <Food name={dish.name} picture={dish.image} />;
}
*/
// 모든 컴포넌트는 유일해야한다

function App() {
  return (
    <div>
      {foodILike.map(dish => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
